import React, { Component } from "react";
import Slide from "react-reveal";
import fourimages from './fourimages.png';

class Adocao extends Component {

  render() {

    return (
      <section>
        <div id="frame1">


          <p id="texto1">Visite as páginas de cães e gatos disponíveis e dedicado para a adoção. Lá você irá encontrar os pets para criar uma conexão perfeita com o cão e/ou gato que busca um novo lar.</p>
          <p id="texto2">O passo seguinte é realizar o cadastro no site e preencher o formulário de interesse para realizar a entrevista e prosseguir com os passos para a adoção. Logo após preencher o formulário, a ONG entrará em contato com você em até 48h.</p>
          <p id="texto3">A ONG irá fazer a análise do cadastro e perfil do adotante vs o pet escolhido. Preenchendo os requisitos, você recebe a aprovação na hora (quando a entrevista é realizada pelo voluntário da ONG) por telefone ou e-mail.</p>
          <p id="texto4">Caso seja aprovado na hora pelo voluntário da ON, você já pode levar seu pet para casa! Se enviou o formulário online, espere o contato e a aprovação. Com tudo certo, você busca seu pet no dia e local combinado com a ONG/protetor.</p>
        </div>
      </section>
    );
  }
}

export default Adocao;
